export function getProducts(){
    fetch("https://localhost:44317/api/EladoTermek")
        .then((response) => {
            return response.json()
        })
        .then(data=>{
            data.forEach((adat) => (
                <div class="termek" onClick={()=>{handleClick(adat.Count)}}>
                    <div><img src={adat.logo} /></div>
                    <div><span id='termekname'>{adat.Name}</span></div>
                    <div><span id='termekprice'>{adat.Price} Ft</span><span id='termekdistance' >{adat.Distance} km</span></div>
                </div>
            ))
        })
        .catch((error) => {
            console.error("Hiba történt:", error);
        })
}
